}

function UnwrappedMap() {

    const [selectedInteraction, setSelectedInteraction] = useState(null);

    const [secOneComplete, setSecOneComplete] = useState(false);



    const eraOneComplete = () => {
        const era = Interaction.locations.Sections[0];
        const quiz = Interaction.locations.Quiz[0];
        const fact = Interaction.locations.Fact[0];

        if ((quiz.complete = true) && (fact.complete = true)) {
            era.complete = true;
            console.log("Era is complete");
        } else {
            era.complete = false;
            console.log("Era not complete yet!!")
        }
    }

    const watch = true;
    const { latitude, longitude } =
        usePosition(watch, {enableHighAccuracy: true});

    const eraComplete = Interaction.locations.Sections[0]
    const quizComplete = Interaction.locations.Quiz[0]
    const FactComplete = Interaction.locations.Fact[0]

    console.log("Era: ", eraComplete.complete)
    console.log("Quiz: ", eraComplete.complete)
    console.log("Era: ", eraComplete.complete)

    return (
        // Creates map
        <GoogleMap
            defaultZoom={20}
